@tokainoaozora 入った時期にもよる
バブル勢は月25万に賞与12ヶ月分と固定昇給あり、手当有り、退職金有り、社員旅行付の無期限雇用
コロナ勢は月17万に賞与無し、昇給無し、手当無し、退職金無し、労災有り、違法残業あり、パワハラあり、ビジネスマナー合宿付の不安定雇用

@fseiichizb4 先週コロナ禍を怖がり、家から買い物以外出なかった 長い御付き合いのある知人さんに会いましたら(３回接種)、
２度目の帯状疱疹にかかったそうです。首には 跡が残っていました😥
本人は コロナ禍によるストレスだと言っておりました… それもありますか？🤔

@ringo_modorin ありがとうー😭
なんか熱以外症状出なくてさ、喉も痛くないからコロナじゃないんだろうなぁ…って思ったけど、体が熱いのにゾクゾクして「永訣の朝」を思い出した😅今はTwitter眺められるくらいには元気だよ！ありがとう😊立つとフラフラするから寝てるの。。
早く普段通りに戻りたい…
